import React from "react";



const Bubble_Container = ({userChats}) => {

	console.log(userChats);

	return (
		<div>
			{arrayOfDictionaries.length > 0 ? (
        arrayOfDictionaries.map((dictionary, index) => (
          <div key={index}>
            <h3>Dictionary {index + 1}</h3>
            <ul>
              {Object.entries(dictionary).map(([key, value]) => (
                <li key={key}>
                  <strong>{key}:</strong> {value}
                </li>
              ))}
            </ul>
          </div>
        ))
      ) : (
        <p>The array of dictionaries is empty.</p>
      )}
		</div>

	);
};

export default Bubble_Container;
